INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 7001, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 7002, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 7003, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 10001, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 10002, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 10003, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 10004, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 12001, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12, "ペコリーヌ", -416.5);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 13001, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 13002, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 13003, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 13004, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 14001, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 14002, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 14003, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 14004, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 15001, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15, "コッコロ", -470.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 16001, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 16002, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 16003, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 16004, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 17002, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 17004, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 25, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 17005, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 25, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 17006, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 25, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 17007, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 25, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 18001, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18, "カリン", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 2, 0, "2015/12/17 15:00:00", 18002, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18, "カリン", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 3, 0, "2015/12/17 15:00:00", 19001, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19, "カリン", -470.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 4, 0, "2015/12/17 15:00:00", 19002, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19, "カリン", -470.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 5, 0, "2015/12/17 15:00:00", 20001, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20, "カリン", -470.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 6, 0, "2015/12/17 15:00:00", 20002, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20, "カリン", -470.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 21001, 1, 1, 0, 106001, "2030/12/17 14:59:59", 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21, "キャル", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 21002, 1, 1, 0, 105901, "2030/12/17 14:59:59", 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21, "コッコロ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 2104010, "2015/12/17 15:00:00", 21003, 1, 2, 0, 106401, "2030/12/17 14:59:59", 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21, "シェフィ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 21004, 1, 1, 0, 105801, "2030/12/17 14:59:59", 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21, "ペコリーヌ", -363.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 1, 0, "2015/12/17 15:00:00", 22001, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22, "カリン", -430.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 2, 0, "2015/12/17 15:00:00", 22002, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22, "カリン", -430.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 3, 0, "2015/12/17 15:00:00", 23001, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23, "カリン", -430.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 4, 0, "2015/12/17 15:00:00", 23002, 1, 1, 0, 190801, "2030/12/17 14:59:59", 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23, "カリン", -430.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 1, 0, "2019/01/31 12:00:00", 24001, 2, 1, 10011, 109001, "2030/12/17 14:59:59", 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 2, 0, "2019/01/31 12:00:00", 24002, 2, 1, 10011, 109001, "2030/12/17 14:59:59", 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 3, 0, "2019/01/31 12:00:00", 24003, 2, 1, 10011, 109001, "2030/12/17 14:59:59", 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 4, 0, "2019/01/31 12:00:00", 24004, 2, 1, 10011, 109001, "2030/12/17 14:59:59", 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 5, 0, "2019/01/31 12:00:00", 24005, 2, 1, 10011, 109001, "2030/12/17 14:59:59", 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, "エリコ（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 6, 0, "2019/01/31 12:00:00", 24006, 1, 1, 10011, 109002, "2030/12/17 14:59:59", 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 7, 0, "2019/01/31 12:00:00", 24007, 1, 1, 10011, 109002, "2030/12/17 14:59:59", 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 8, 0, "2019/01/31 12:00:00", 24008, 1, 1, 10011, 109002, "2030/12/17 14:59:59", 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 9, 0, "2019/01/31 12:00:00", 24009, 1, 1, 10011, 109002, "2030/12/17 14:59:59", 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10, 0, "2019/01/31 12:00:00", 24010, 1, 1, 10011, 109002, "2030/12/17 14:59:59", 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, "エリコ（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 1, 0, "2019/01/31 12:00:00", 24011, 2, 1, 10011, 109101, "2030/12/17 14:59:59", 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 2, 0, "2019/01/31 12:00:00", 24012, 2, 5, 10011, 109101, "2030/12/17 14:59:59", 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 3, 0, "2019/01/31 12:00:00", 24013, 4, 2, 10011, 109101, "2030/12/17 14:59:59", 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 4, 0, "2019/01/31 12:00:00", 24014, 1, 1, 10011, 109102, "2030/12/17 14:59:59", 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 5, 0, "2019/01/31 12:00:00", 24015, 2, 5, 10011, 109101, "2030/12/17 14:59:59", 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 6, 0, "2019/01/31 12:00:00", 24016, 1, 1, 10011, 109102, "2030/12/17 14:59:59", 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (8.0, 7, 0, "2019/01/31 12:00:00", 24017, 2, 1, 10011, 109101, "2030/12/17 14:59:59", 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24, "シズル（バレンタイン）", -385.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 8, 0, "2019/01/31 12:00:00", 24018, 1, 1, 10011, 109102, "2030/12/17 14:59:59", 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 9, 0, "2019/01/31 12:00:00", 24019, 1, 1, 10011, 109102, "2030/12/17 14:59:59", 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24, "シズル（バレンタイン）", 0.0);
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 10, 0, "2019/01/31 12:00:00", 24020, 1, 1, 10011, 109102, "2030/12/17 14:59:59", 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24, "シズル（バレンタイン）", 0.0);
