INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 2, 0, "2015/12/17 15:00:00", 43005, 1, 1, 0, 123001, "2030/12/17 14:59:59", 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, "アメス", -416.5);
